import Link from 'next/link'

const Contact = () => {
    return (
        <>
            <nav>
                <Link href={'/'}><a>Home</a></Link>
                <Link href={'/about'}><a>About Us</a></Link>
                <Link href={'/contact'}><a>Contact Us</a></Link>
            </nav>
            <h1>Contact us</h1>
        </>
    )
};

export default Contact;
